create table pcr_credit_acc_last_mm
(
    id                              varchar(64)    not null comment '主键ID',
    order_id                        varchar(64)    null comment '订单流水号',
    serial_id                       varchar(64)    null comment '数据流水号',
    etl_id                          varchar(64)    null comment '清洗流水号',
    report_id                       varchar(32)    null comment '报告编号',
    lastmm_datetime_yymm            varchar(20)    null comment '月份',
    lastmm_account_state_code       varchar(60)    null comment '账户状态',
    lastmm_balance                  decimal(12, 2) null comment '余额',
    creditacc_used_amount           decimal(12, 2) null comment '已用额度',
    un_installment_balance          decimal(12, 2) null comment '未出单的大额专项分期余额',
    lastmm_five_level_code          varchar(60)    null comment '五级分类',
    remaining_period_num            int            null comment '剩余还款期数',
    lastmm_settlement_datetime      datetime       null comment '结算/应还款日',
    mm_due                          decimal(12, 2) null comment '本月应还款',
    mm_actual                       decimal(12, 2) null comment '本月实还款',
    lastmm_last_repay_datetime      datetime       null comment '最近一次还款日期',
    overdue_num                     int            null comment '当前逾期期数',
    overdue_amount                  decimal(12, 2) null comment '当前逾期总额',
    overdue_31_60_principal         decimal(12, 2) null comment '逾期31—60天未还本金',
    overdue_61_90_principal         decimal(12, 2) null comment '逾期61－90天未还本金',
    overdue_91_180_principal        decimal(12, 2) null comment '逾期91－180天未还本金',
    overdue_180_principal           decimal(12, 2) null comment '逾期180天以上未还本金',
    used_180_un_balance             decimal(12, 2) null comment '透支180天以上未付余额',
    lastmm_avg_6_mm_used_amount     decimal(12, 2) null comment '最近6个月平均使用额度',
    lastmm_recent_6_mm_used_balance decimal(12, 2) null comment '最近6个月平均透支余额',
    max_use_credit                  decimal(12, 2) null comment '最大使用额度',
    max_used_balance                decimal(12, 2) null comment '最大透支余额',
    update_datetime                 datetime       null comment '信息报告日期',
    fk_id                           varchar(32)    null comment '外键FK_ID',
    creditacc_account_no            varchar(30)    null comment '账户编号',
    create_time                     datetime       not null comment '入库时间',
    primary key (id, create_time)
)
    comment 'D_01_02-最近一次月度表现' engine = InnoDB;

create index idx_etl_report_account_no
    on pcr_credit_acc_last_mm (etl_id, report_id, creditacc_account_no);

